Thanks to every one who supported me last year. 2014 was maybe a bit quiet, but it also had great things.. Like I got signed at Musicallstars Publishing! But 2015 will be much better, my next track is coming very soon! So to end 2014 I made this deep house bootleg. It's something different than I normal make but it's cool! 

Support / Feedback list:
